import React from 'react'
import {AppBar, Toolbar, Button} from '@material-ui/core'


function Header() {
  return (
    <AppBar position="sticky" color="">
      <Toolbar>
        <Button>Home</Button>
        <Button>About</Button>
      </Toolbar>
    </AppBar>
  )
}

export default Header
